import React from 'react'
import {store} from './Store/store.js'
import { Provider } from "react-redux";
import AccueilInscription from './Componants/AccueilInscription.js';
import AddInscription from './Componants/AddInscription.js';
import EditInscription from './Componants/EditInscription.js';
import { BrowserRouter , Routes ,Route,Link} from 'react-router-dom';
export default function App() {
  return (      
      <Provider store={store}>             
          
                  <Routes>
                              <Route path="/" element={<AccueilInscription />}/>
                              <Route path="/add-inscription" element={<AddInscription />}/>                                  
                              <Route path="/edit-inscription/:id" element={<EditInscription />}/>
                              <Route path="/component1" element={<App />}/>                                  
                              <Route path="/component2" element={<App />}/>                                  
                  </Routes>      
           
      </Provider>      
   )
}
